// src/components/HeroSection/HeroSection.js
import React from 'react';
import './HeroSection.css';

function HeroSection() {
  return (
    <section className="hero">
      <div className="hero-content">
        <h1 className="hero-title">Welcome to Our Website</h1>
        <p className="hero-subtitle">We provide amazing services to help you grow.</p>
        <div className="hero-buttons">
          <a href="#services" className="hero-button primary">Our Services</a>
          <a href="#contact" className="hero-button secondary">Contact Us</a>
        </div>
      </div>
    </section>
  );
}

export default HeroSection;
